-- ----------------------------
-- Table structure for `npcbudget`
-- ----------------------------
DROP TABLE IF EXISTS `npcbudget`;
CREATE TABLE `npcbudget` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `timestamp` bigint(20) DEFAULT NULL,
  `in_name` varchar(255) DEFAULT NULL,
  `nt_code` varchar(255) DEFAULT NULL,
  `budget_money` int(10) DEFAULT NULL,
  `dt_code` varchar(255) DEFAULT NULL,
  `nt_name_lvl1` varchar(255) DEFAULT NULL,
  `bs_name_lvl1` varchar(255) DEFAULT NULL,
  `bs_name_lvl2` varchar(255) DEFAULT NULL,
  `in_code` varchar(255) DEFAULT NULL,
  `nt_name_lvl2` varchar(255) DEFAULT NULL,
  `nt_name_lvl4` varchar(255) DEFAULT NULL,
  `adjustment_money` int(10) DEFAULT NULL,
  `bs_code` varchar(255) DEFAULT NULL,
  `nt_name_lvl3` varchar(255) DEFAULT NULL,
  `row_number` varchar(255) DEFAULT NULL,
  `final_money` int(10) DEFAULT NULL,
  `pkid` varchar(255) DEFAULT NULL,
  `DPO_Org2` varchar(255) DEFAULT NULL,
  `dt_month` varchar(255) DEFAULT NULL,
  `dt_year` varchar(255) DEFAULT NULL,
  `DPO_Org1` varchar(255) DEFAULT NULL,
  `dt_name` varchar(255) DEFAULT NULL,
  `bs_name_lvl3` varchar(255) DEFAULT NULL,
  `state_name` varchar(255) DEFAULT NULL,
  `state_code` varchar(255) DEFAULT NULL,
  `modify_type` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `timestamp` (`timestamp`)
) ENGINE=InnoDB AUTO_INCREMENT=1190 DEFAULT CHARSET=utf8;

